import React, { useEffect } from 'react';
import { useStateContext } from '../context/StateContext';

const FDPage = () => {
  const { originalFDs, fetchOriginalFDs } = useStateContext();

  useEffect(() => {
    fetchOriginalFDs();  // Fetch FDs on mount
  }, [fetchOriginalFDs]);

  return (
    <div className="fd-page">
      <h2>Functional Dependencies</h2>
      {originalFDs.length > 0 ? (
        <ul>
          {originalFDs.map((fd, index) => (
            <li key={index}>
              {fd.lhs.join(', ')} â†’ {fd.rhs.join(', ')}
            </li>
          ))}
        </ul>
      ) : (
        <p>No Functional Dependencies found.</p>
      )}
    </div>
  );
};

export default FDPage;
